$(document).ready(()=>{const t=i=>{var u=luxon.Duration.fromMillis(i.beginTime),f=u.as("milliseconds"),r;f<=0&&(window.location="/"+appealId);r=u.shiftTo("hours","minutes").toObject();$("#remainingHours").text(r.hours);$("#remainingMinutes").text(Math.round(r.minutes));setTimeout(updateInfo,n,n,appealId,t)},n=1e4;updateInfo(n,appealId,t)});